import React from 'react'
import CustomBtn from '../../Components/CustomeBtn/CustomBtn'
import { Tabs } from '../../Components/StyledComponents/Index'
import { useState } from 'react';

const NavTab = ({ setActiveTab }) => {
    const handleClick = () => {
        setActiveTab('chatsProfile');
    };

    return (
        <Tabs className='bg-[#00ff15] w-[10%] items-center'>
        <CustomBtn text='message' onClick={handleClick} />
        </Tabs>
    );
};

const ChatsProfileTabs = ({ activeTab, setActiveTab }) => {
    const handleClick = () => {
        setActiveTab('chats');
    };

    return (
        <Tabs
        className={`bg-${activeTab === 'chatsProfile' ? 'green' : 'blue'} w-[25%]`}
        >
        <p>Chats Profile</p>
        <CustomBtn text='Open Chat' onClick={handleClick} />
        </Tabs>
    );
};

const ChatsTabs = ({ activeTab }) => {
    return (
        <Tabs className={`bg-${activeTab === 'chats' ? 'red' : 'blue'} w-[50%]`}>
        <p>Chats</p>
        </Tabs>
    );
};

const ProfileTab = ({ activeTab }) => {
    return (
        <Tabs
        className={`bg-${activeTab === 'profile' ? 'blue' : 'red'} w-[25%]`}
        >
        <p>Profile</p>
        </Tabs>
    );
};

const Main = () => {
  const [activeTab, setActiveTab] = useState('chatsProfile');

  return (
    <div className='flex flex-col items-center h-screen'>
      <div className='flex items-center bg-slate-400 w-[75%]'>
        <NavTab setActiveTab={setActiveTab} />
        <ChatsProfileTabs
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
        <ChatsTabs activeTab={activeTab} />
        <ProfileTab activeTab={activeTab} />
      </div>
    </div>
  );
};


export default Main
